import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <h1>PORTFOLIO OF TAKEUCHI MIKI</h1>
      <div id="wrapper">
        <span />
        <span />
        <span />
        <nav id="global-navi">
          <ul class="menu">     
            <li><a href="#home">HOME</a></li>
            <li><a href="/profile">PROFILE</a></li>
            <li><a href="/contact">CONTACT</a></li>
          </ul>
        </nav>
      </div>
    </div>
  );
}

export default App;
